import { baseic } from "./ApiClient";


export const basicauth= (token)=>baseic.get(`basicauth`,{
    headers:{
        Authorization:token
    }
})

export const JOTauth= (username,password,batoken)=>{
    console.log(batoken)
    baseic.post(`authenticate`,{
        headers:{
            Authorization:batoken
        }
    },{username,password})

}
